//frontend/src/App.js

import React, { useState } from 'react';
import axios from 'axios';
import './styles.css';

function App() {
    const [startMovie, setStartMovie] = useState('');
    const [endMovie, setEndMovie] = useState('');
    const [bfsPath, setBfsPath] = useState(null);
    const [dijkstraPath, setDijkstraPath] = useState(null);

    const searchMovies = async () => {
        const res = await axios.get(`/search_path?start=${startMovie}&end=${endMovie}`);
        setBfsPath(res.data.bfs_path);
        setDijkstraPath(res.data.dijkstra_path);
    };

    return (
        <div className="container">
            <h1>Movie Path Finder</h1>
            <input type="text" value={startMovie} onChange={e => setStartMovie(e.target.value)} placeholder="Start Movie"/>
            <input type="text" value={endMovie} onChange={e => setEndMovie(e.target.value)} placeholder="End Movie"/>
            <button onClick={searchMovies}>Find Path</button>

            {bfsPath && (
                <div>
                    <h2>BFS Path:</h2>
                    <p>{bfsPath.join(' -> ')}</p>
                </div>
            )}

            {dijkstraPath && (
                <div>
                    <h2>Dijkstra Path:</h2>
                    <p>{dijkstraPath.join(' -> ')}</p>
                </div>
            )}
        </div>
    );
}

export default App;
